import{j as t,o,c as n,k as a}from"./app.b44362ad.js";const r={class:"prose prose-sm m-auto text-left"},i=a('<p><a href="/about">\u4E2D\u6587</a> | English</p><p>The Software Association of South China Normal University (SoCoding) is a free academic organization oriented to technology and interest, formed by the software and hardware technology enthusiasts among the students of South China Normal University on their own initiative, under the leadership of the Party Committee of the University and the guidance of the University Youth League Committee and the School of Software.</p><p>Our members are both open source software enthusiasts, program developers, OIers, game development enthusiasts, as well as art painters and designers.</p><p>Our members have won awards in many algorithm competitions, game development competitions, unmanned car competitions, and innovation and entrepreneurship competitions. We have several veteran members who have joined big Internet companies, as well as rising stars who have entered ByteDance and Tencent as early as their freshman, sophomore and junior years for internships.</p><p>The purpose of Software Association is</p><ul><li>To serve the students and teachers at school as the fundamental, to give back to the open source community as the vision, and to contribute to the development of the open source cause.</li><li>To focus on cutting-edge computer hardware and software and Internet-related industries, explore related technologies, and export content.</li><li>To create an excellent academic atmosphere for computer software and hardware, and to provide a platform for enthusiasts to communicate and learn.</li></ul><p>We look forward to getting to know you, learning cutting-edge technologies and growing together. Welcome you to join us.</p><p><a href="/bylaws">Articles of association By-laws</a></p><p><a href="/recruitment">Recruiting Instructions of SoCoding</a></p>',9),s=[i],m={title:"About | SCNU SoCoding",meta:[{property:"og:title",content:"About | SCNU SoCoding"}]},u={__name:"about",setup(c,{expose:e}){return t({title:"About | SCNU SoCoding",meta:[{property:"og:title",content:"About | SCNU SoCoding"}]}),e({frontmatter:{title:"About | SCNU SoCoding",meta:[{property:"og:title",content:"About | SCNU SoCoding"}]}}),(h,p)=>(o(),n("div",r,s))}};export{u as default,m as frontmatter};
